import { GET_FILE_SUCCESS, CLEAR_FILE } from '../Action/type';
let initialize = {
    fileData: null
}

export default function FileUpload(state = initialize, action) {
    switch (action.type) {
        case GET_FILE_SUCCESS:
            return {
                ...state,
                fileData: action.payload
            }
        case CLEAR_FILE:
            return {
                ...state,
                fileData: action.payload

            }
        default:
            return state
    }
}
